ees'];\n      $department = getDeptByEmail($list, $data['reviewer']['email']);\n      $list = getDeptEmployees($list, $department);\n      return $list;\n      \n    } catch (Exception $e) {\n      \/\/ output error message if fails\n      return [[\n        \"displayName\" => $data['reviewer']['name'],\n        \"workEmail\" => $data['reviewer']['email']\n      ]];\n    }\n    break;\n  default:\n    return [];\n}\n\nfunction getDeptByEmail($list, $email)\n{\n  try {\n    foreach ($list as $employee) {\n      if($employee->workEmail === $email){\n        return $employee->department;\n      }\n    }\n  } catch (Exception $exception) {\n    throw $exception;\n  }\n}\n\nfunction getDeptEmployees($list, $department)\n{\n  try {\n    $employeeList = [];\n    foreach ($list as $employee) {\n      if(!isset($department) || $employee->department === $department){\n        $employeeList[] = [\n          'displayName' => $employee->displayName,\n          'workEmail' => $employee->workEmail\n        ];\n      }\n    }\n    return $employeeList;\n  } catch (Exception $exception) {\n    throw $exception;\n  }\n}","retry_wait_time":5,"retry_attempts":0,"timeout":60,"run_as_user_id":1,"created_at":"2024-01-05T15:13:08+00:00","updated_at":"2024-02-19T13:22:37+00:00","status":"ACTIVE","script_category_id":"5","script_executor_id":10,"is_template":0,"asset_type":null,"projects":"[]"},"script_id":"25","script_key":null,"output_variable":"potentialApprovers","uid":"17048110658911"}]", "asset_type": null, "created_at": "2023-11-27 15:38:48", "custom_css": "[selector=invoiceDate] 
